query SearchOrderVariant($first: Int!, $query: String!, $after: String) {
  search: products(first: $first, after: $after, filter: {search: $query}) {
    edges {
      node {
        id
        name
        thumbnail {
          url
          __typename
        }
        variants {
          id
          name
          sku
          pricing {
            priceUndiscounted {
              net {
                amount
                currency
                __typename
              }
              __typename
            }
            __typename
          }
          __typename
        }
        __typename
      }
      __typename
    }
    pageInfo {
      endCursor
      hasNextPage
      hasPreviousPage
      startCursor
      __typename
    }
    __typename
  }
}
